import React,{useState}from "react";
import Page from "./Page.js";
import "./Content.css";
import Plan from "./Plan.js";


function Content() {
  const[page, setPage] = useState(1);
  return (
    <div className="btnContainer">

      <div className={page === 1 ? "clicked":"btn"} onClick={() => setPage(1)}>1</div>


      <div className={page === 2 ? "clicked btn":"btn"} onClick={() => setPage(2)}>2</div>


      <div className="btn">3</div>

      {page === 1 && <Page/>}

      {page === 2 && <Plan/>}
      </div>

  );
}
export default Content;
